import logo from './logo.svg';
import './App.css';
import Data from './views/Data';
import Main from './views/Main'
import { Route, IndexRoute } from 'react-router';
function App() {
  return (
    <div className="App">
      <Route path="/" component={Main}>
        <Route path="/dashboard" component={Data} />
      </Route>

    </div>
  );
}

export default App;
